import React, { Component } from 'react'
import { getData } from '../../api/info'
import { Table } from 'antd'

const columns = [
    {
        title: '品牌',
        dataIndex: 'brand',
        width:90
        // key: 'stock',
    },
    {
        title: '产品',
        dataIndex: 'proname',
        // key: 'stock',
    },
    {
        title: '价格',
        dataIndex: 'price',
        // key: 'stock',
    },
    {
        title: '图片',
        dataIndex: 'proimg',
        // key: 'stock'
    },
    {
        title: '配置',
        dataIndex: 'note',
        // key: 'stock'
    },
];


class AddList extends Component {
    constructor() {
        super()
        this.state = {
            dataSource: []
        }
    }
    componentDidMount() {
        getData(1, 2).then(res => {
            console.log(res.data)
            this.setState({ dataSource: res.data })
        })
    }
    render() {
        let { dataSource } = this.state
        return (
            <div>
                <Table dataSource={dataSource} columns={columns} rowKey='stock' />;
            </div>
        )
    }
}
export default AddList
